    "2015-09-26T23:10:47.978920",nt"name": "2004-usace-puerto-rico-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "This record describes Light Detection and
    Ranging (Lidar) data acquired for the island of Puerto Rico. The data were acquired
    for USACE, St. Louis District by 3001, Inc., between January 10 and February 8,
    2004. The mission was flown at a density sufficient to support a maximum final post
    spacing of 6 feet for unobscured areas. The Puerto Rico LiDAR Survey was collected
    under the guidance of a Professional Mapper/Surveyor.",nt"license_title": null,nt"extras":
